#include <string.h>
#include <stdio.h>
#include <stdlib.h>
#include <assert.h>

#define LEN_EACH_ARRAY 110
#define MAX_NUM_OF_ARRAY 1000
#define MAX_TMP_INPUT LEN_EACH_ARRAY*MAX_NUM_OF_ARRAY

int main(void)
{
	char** pointer_of_array = malloc(MAX_NUM_OF_ARRAY);
	char* pointer_of_tmp_input = malloc(MAX_TMP_INPUT);
	assert (pointer_of_array != NULL);
	assert(pointer_of_tmp_input != NULL);
	memset(pointer_of_array, 0, MAX_NUM_OF_ARRAY);
	memset(pointer_of_tmp_input, 0, MAX_TMP_INPUT);
	char split_char = 0;
	//remember: malloc - assert - memset

	scanf("%s", pointer_of_tmp_input);
	scanf(" %c", &split_char);

	*pointer_of_array = pointer_of_tmp_input;
	char* searching = pointer_of_tmp_input;

	int num_of_array = 1;
	for (num_of_array = 1; num_of_array < MAX_NUM_OF_ARRAY + 5; num_of_array++)
	{
		searching = memchr(searching, split_char, LEN_EACH_ARRAY);

		if (searching == NULL)
			break;

		*searching = 0;
		searching++;
		*(pointer_of_array + num_of_array) = searching;
	}

	for (int i = 0; i < num_of_array - 1; i++)
	{
		for (int j = 0; j < num_of_array - 1 - i; j++)
		{
			if (strncmp(*(pointer_of_array + j), *(pointer_of_array + j + 1), LEN_EACH_ARRAY) > 0)
			{
				char* tmp_swap = 0;
				tmp_swap = *(pointer_of_array + j + 1);
				*(pointer_of_array + j + 1) = *(pointer_of_array + j);
				*(pointer_of_array + j) = tmp_swap;
				//发现：指针不能进行位运算，一定要做的话，先设一份临时long拷贝，交换完后再赋值给地址变量
			}
		}
	}

	for (int i = 0; i < num_of_array; i++)
	{
		printf("%s\n", *(pointer_of_array + i));
	}

	free(pointer_of_tmp_input);
	free(pointer_of_array);
	return 0;
}








